import React from 'react';
import Navbar from './components/Navbar'
import { render } from "react-dom"
import { 
  BrowserRouter, 
  Routes, 
  Route} from 'react-router-dom';
import './App.css';
import Home from './components/pages/Home';

render (
    <>
      <BrowserRouter>
        <Navbar/>
        <Routes>
          <Route path='/' element={<Home/>}/>
        </Routes>
      </BrowserRouter>


    </>
);
